<!DOCTYPE html>
<html>
<head>
    <title>List of Images</title>
</head>
<body>
    <h1>Images in S3 Bucket</h1>
    <ul>
        {% for image in images %}
            <li><a href="https://imagescreatedbyme.s3.amazonaws.com/{{ image }}">{{ image }}</a></li>
        {% endfor %}
    </ul>
</body>
</html>
